import React from "react";
import { motion } from "framer-motion";
import Header from "../Header/Header";
import Footer from "../Footer/Footer";
import "../Contacto/Contacto.css";

const Contact = () => {
  return (
    <div className="contact-container">
      <Header />

      {/* SECCIÓN DE CONTACTO */}
      <section className="contact-info">
        <div className="contact-text">
          <h2>¿Necesitas más información?</h2>
          <p>
            Solucionamos sus necesidades de mantenimiento, reparaciones, remodelaciones, diseños,
            obras civiles y arquitectónicas.
          </p>
          <img src="/imagenes/contacto2.png" alt="Siempre en obra" className="contact-banner" />
        </div>

        {/* FORMULARIO */}
        <form className="contact-form">
          <input type="text" placeholder="Nombre completo" required />
          <input type="email" placeholder="Correo electrónico" required />
          <input type="tel" placeholder="Teléfono" required />
          <textarea placeholder="Comentario" rows="4" required></textarea>
          <button type="submit">Enviar</button>
        </form>
      </section>

      {/* IMAGEN DEL EQUIPO */}
      <section className="team-section">
        <h2>Nuestro equipo está listo para atenderte</h2>
        <img src="/imagenes/contacto.png" alt="Equipo de trabajo" className="team-image" />
      </section>

      {/* PIE DE PÁGINA */}
      <Footer />
    </div>
  );
};

export default Contact;
